import React, { useState } from "react";
import styles from "./App.module.css";
import ExerciseCard from "./Exercisecard";
import SearchableDropdown,{NewExercise} from "./Searchable";
function App() {
    const [value, setValue] = useState("Select option...");
    return (
        <div>
            <ExerciseCard exerciseName="Chest Press" />
            <ExerciseCard exerciseName="Leg Press" />
            <ExerciseCard exerciseName="Incline Press" />

            <NewExercise    
                options={[
  { id: 1, name: "Push-up" },
  { id: 2, name: "Squat" },
  { id: 3, name: "Deadlift" },
  { id: 4, name: "Pull-up" },
  { id: 5, name: "Bench Press" },
  { id: 6, name: "Plank" },
  { id: 7, name: "Lunges" },
  { id: 8, name: "Bicep Curl" },
  { id: 9, name: "Tricep Dip" },
  { id: 10, name: "Leg Press" }
]
}
                label="name"
                id="id"
                selectedVal={value}
                handleChange={(val) => setValue(val)}
            />
        </div>
    );
}

export default App;
